import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import './App.css';
import Login from './pages/Login';
import CashierPOS from './pages/CashierPOS';
import CustomerPOS from './pages/CustomerPOS';
import DispatchCounter from './pages/DispatchCounter';
import KitchenKDS1 from './pages/KitchenKDS1';
import KitchenKDS2 from './pages/KitchenKDS2';
import KitchenKDS3 from './pages/KitchenKDS3';
import Manager360View from './pages/Manager360View';
import OrderStatusDiningDisplayTV from './pages/OrderStatusDiningDisplayTV';
import Home from './pages/OrderStatusKitchenDisplayTV';
function App() {
  return (
    <Router>
        <div>
          <Route exact path="/" component={Login}/>
          <Route path="/cashier-pos" component={CashierPOS}/>
          <Route path="/customer-pos" component={CustomerPOS}/>
          <Route path="/dispatch-counter" component={DispatchCounter}/>
          <Route path="/kitchen-kds-1" component={KitchenKDS1}/>
          <Route path="/kitchen-kds-2" component={KitchenKDS2}/>
          <Route path="/kitchen-kds-3" component={KitchenKDS3}/>
          <Route path="/manager-360-view" component={Manager360View}/>
          <Route path="/order-status-dining-display-tv" component={OrderStatusDiningDisplayTV}/>
          <Route path="/order-status-kitchen-display-tv" component={OrderStatusKitchenDisplayTV}/>
          <Route exact path="/" component={Login}/>
        </div>
      </Router>
  );  
}

export default App;
